        //             <label>
        //                 OpenAI API-Key:
        //                 <input type="password" value={apikey} onChange={handleKeyChange} autoFocus />
        //             </label>
        //             <label>
        //                 OpenAI ORG ID:
        //                 <input type="password" value={org} onChange={handleOrgChange} placeholder='optional'/>
        //             </label>
        //             <button type="submit">Enter</button>
        //         </form>
        //     </div>
        // </div>
        <div class="form-style-6" style={{ position: 'fixed', height: '40%', width: '80%', top: '30vh', left: 0, right: 0, bottom: 0, alignItems: 'center', zIndex: '10000', justifyContent: 'center' }}>
        {/* <h1>LEAP needs some information from you...</h1> */}
        <form onSubmit={handleSubmit}>
        <label>OpenAI API-Key <span class="required">*</span>
        <input type="password" name="field1" value={apikey} onChange={handleKeyChange} autoFocus/>
        </label>
        <label>OpenAI ORG ID
        <input type="password" name="field2" value={org} onChange={handleOrgChange}/>
        </label>
        <input type="submit" value="Getting Started with LEAP" />
        </form>
        </div>
    );
}

export default KeyModal;
